export const selectUser = (user) => {
  console.log("You clicked", user.name);
  return {
    type: "USER_SELECTED",
    payload: user
  }
}

export const removeUser = (index) => {
  console.log("You remove", index);
  return {
    type: "USER_REMOVED",
    payload: index
  }
}
